import React from 'react';

const Title = ({ title }) => {  // Destructure the 'title' prop
    return (
        <div style={styles.container}>
            <span style={styles.text}>{title}</span>  {/* Use span or p instead of text */}
        </div>
    );
};

const styles = {
    container: {
        backgroundColor: '#2a2829',
        flex: '100%',
        padding: '20px',  // Optional: add padding for spacing
    },

    text: {
        fontSize: '30px',
        color: 'white',  // Optional: make the text color white
    },
};

export default Title;
